import React from 'react';
import styled from 'styled-components';
import cart from '../images/cart.jpg';

const CartPage = () => {
	return (
		<CartPageWrapper>
			<div className='banner'>
				<img src={cart} alt='' />
			</div>
			<p className='banner-txt'>Your Cart</p>
		</CartPageWrapper>
	);
};

export default CartPage;
const CartPageWrapper = styled.section`
	position: relative;
	top: 71px;
	width: 100%;
	.banner {
        width 100%;
        position:relative;
    }

    .banner img{
        width: 100%;
    }

    .banner-txt{
        position:absolute;
        top:50%;
        left: 50%;
        transform:translate(-50%,-50%);
        font-size: 2rem;
        background:orange;
        padding: 1rem 2rem;
        color:#fff;
    }
`;
